<div class="fullscreen" onclick="toggleFullscreen()">
    <img src="img/fullscreen.svg">
    <div class="corner-tooltip">Toggle Fullscreen</br>(ALT + F)</div>
</div>
<div class="copy" onclick="copyURL()">
    <img src="img/copy.svg">
    <div class="corner-tooltip"style="right: -20px;">Copy</br>(ALT + C)</div>
</div>
<div class="menu">
    <div class="switch">
        <label>
            <input id="autosave" type="checkbox">
            <span onclick="toggleAutosave()" class="slider round"></span>
        </label>
        AutoSave
    </div>
    <div id="butRecents">
        Recent
        <div>

        </div>
    </div>
    <div id="butNew" class="tooltip" onclick="newFile()">
        New
        <div class="tooltiptext">
            (ALT + N)
        </div>
    </div>
    <div id="butOpen" class="tooltip" onclick="openFile()">
        Open
        <div class="tooltiptext">
            (CTRL + O)
        </div>
    </div>
    <div id="butSave" class="tooltip" onclick="saveFile()">
        Save
        <div class="tooltiptext">
            (CTRL + S)
        </div>
    </div>
    <div id="butSaveAs" class="tooltip" onclick="saveFileAs()">
        Save As
    </div>
</div>
<div id="load-data">
    <div>
        <label for="data-url">URL:</label>
        <input id="data-url" name="data-url" type="text">
        <button onclick="loadData()">Load</button>
    </div>
</div>
<div id="app">
    <div class="container" id="positive">
        <h1 class="section-header">
            What Went Well
        </h1>
        <div class="cards">
        </div>
        <div class="bottom">
            <button class="add-card" onclick="appendCard('positive')"></button>
            <button class="clear-column" onclick="clearColumn('positive')"></button>
        </div>
    </div>
    <div class="container" id="negative">
        <h1 class="section-header">
            Improvement Needed
        </h1>
        <div class="cards">
            <div id="divider"></div>
        </div>
        <div class="bottom">
            <button class="add-card" onclick="appendCard('negative')"></button>
            <button class="clear-column" onclick="clearColumn('negative')"></button>
        </div>
    </div>
</div>
<footer>Not Saved</footer>

<div id="details-modal" class="modal" onclick="closeModal()">

    <div class="modal-content animate__faster">
        <span class="close" onclick="closeModal()">&#10005;</span>
        <h1>Details</h1>
        <div>
        </div>
        <div class="footer">
            <button onclick="closeModal()">OK</button>
        </div>
    </div>
  
</div>
